# Ignatovka, Republic of Bashkortostan

}}
Ignatovka () is a rural locality (a village) in Chishminsky Selsoviet, Chishminsky District, Bashkortostan, Russia. The village has 5 streets and, as of 2010, a population of 364.
Geography
Ignatovka is located 11 km southwest of Chishmy, the administrative center of the district. Isakovka is the nearest rural locality.
